  /**
   * Register the stylesheets for the public-facing side of the site.
   *
   * @since    1.0.0
   */
  public function enqueue_styles()
  {
    /**
     * This function is provided for demonstration purposes only.
     *
     * An instance of this class should be passed to the run() function
     * defined in Oxymade_Loader as all of the hooks are defined
     * in that particular class.
     *
     * The Oxymade_Loader will then create the relationship
     * between the defined hooks and the functions defined in this
     * class.
     */
     
     $user_level = get_option("oxymade_user_level");
     

    if (defined("SHOW_CT_BUILDER")) {
      wp_enqueue_style(
        $this->plugin_name,
        plugin_dir_url(__FILE__) . "css/oxymade-public.css",
        [],
        $this->version,
        "all"
      );
      if($user_level == "pro"){
      wp_enqueue_style(
        "oxymade-hover-css",
        plugin_dir_url(__FILE__) . "css/oxymade-hovers.css",
        [],
        $this->version,
        "all"
      );
    }
    }

    wp_register_style("oxymade", false);
    wp_enqueue_style("oxymade");
    
    $custom_css = get_option("oxymade_custom_css");
    wp_add_inline_style($this->plugin_name, $custom_css);
    
      $oxymade_html_font_size = get_option("oxymade_html_font_size");
       $oxymade_body_font_size = get_option("oxymade_body_font_size");
       $oxymade_body_font_size_calc = get_option("oxymade_body_font_size_calc");
       if (empty($oxymade_html_font_size) || !isset($oxymade_html_font_size)) {
         $oxymade_html_font_size = 62.5;
       }
       if (empty($oxymade_body_font_size) || !isset($oxymade_body_font_size)) {
         $oxymade_body_font_size = 1.6;
       }
       if (empty($oxymade_body_font_size_calc) || !isset($oxymade_body_font_size_calc)) {
         $oxymade_body_font_size_calc = "";
         $oxymade_base_font_size_custom_css =
          "html { font-size: " .
          $oxymade_html_font_size .
          "%; } body { font-size: " .
          $oxymade_body_font_size .
          "rem; }";
       } else {
       $oxymade_base_font_size_custom_css =
         "html { font-size: " .
         $oxymade_html_font_size .
         "%; } body { font-size: " .
         $oxymade_body_font_size .
         "rem; }";
        }
  
      wp_add_inline_style($this->plugin_name, $oxymade_base_font_size_custom_css);
      
      
      $omft_basics = get_option("oxymade_fluid_typography_basics");
      $omft_vars = get_option("oxymade_fluid_typography_vars");
      $omft_advanced = get_option("oxymade_fluid_typography_advanced");
      
      if (isset($omft_basics) || isset($omft_vars) || isset($omft_advanced) || !empty($omft_basics) || !empty($omft_vars) || !empty($omft_advanced)) {
          $oxymade_fluid_typography_vars = get_option("oxymade_fluid_typography_vars");
          wp_add_inline_style($this->plugin_name, $oxymade_fluid_typography_vars);
      }
      

    $oxymade_blogzine_css = get_option("oxymade_blogzine_css");
    $oxymade_blogzine_css_status = get_option("oxymade_blogzine");
    if (
      isset($oxymade_blogzine_css_status) &&
      $oxymade_blogzine_css_status == "Enable" &&
      isset($oxymade_blogzine_css) &&
      !empty($oxymade_blogzine_css)
    ) {
      wp_add_inline_style($this->plugin_name, $oxymade_blogzine_css);
    }

    // add_action("after_setup_theme", "oxymade_gutenberg_css");
  }
  

